class Solution:
    def canConvertString(self, s: str, t: str, k: int) -> bool:
        ls = len(s)
        lt = len(t)
        if ls != lt: return False
        shifts = []
        for i in range(ls):
            dif = ord(t[i]) - ord(s[i])
            if dif < 0: dif += 26
            shifts.append(dif)
        shifts = sorted(shifts)
        print(shifts)
        while len(shifts) and shifts[0] == 0: shifts.pop(0)
        for i in range(1, k+1):
            print(i, shifts[0], end=", ")
            if shifts[0] == i:
                shifts.pop(0)
                if len(shifts) == 0: return True
            elif shifts[0] < i:
                while shifts[0] < i:
                    temp = shifts.pop(0)
                    shifts.append(temp+26)
                shifts = sorted(shifts)
                if shifts[0] == i:
                    shifts.pop(0)
                    if len(shifts) == 0: return True
        return len(shifts) == 0

